 spot alone atop the fantasy tight-end summit. Next week's opponent, the Tampa Bay Buccaneers, boasts a pair of athletic coverage linebackers patrolling the middle of the field, but Kelce is a must-start player regardless of matchup.\",\"title\":\"Catches game-winning score\"},{\"timeEpochMilli\":\"1606106800000\",\"contents\":\"Kansas City Chiefs tight end Travis Kelce caught 8 passes for 127 yards and one touchdown versus the Las Vegas Raiders in Week 11. Kelce's touchdown was a 22-yard catch that turned out to be the game winning score Kansas City. Kelce has now topped 100yards in three consecutive games and has two touchdowns over that span. Kelce will face a tough Tampa Bay Buccaneers Defense in Week 12, but he has proven he is a different breed and is in a class of his own when it comes to the tight end ...\",\"url\":\"https://www.rotoballer.com/player-news/travis-kelce-scores-winning-touchdown-in-week-11/807012\",\"title\":\"Travis Kelce Scores Winning Touchdown In Week 11\"}],\"nameFirst\":\"Travis\",\"nameLast\":\"Kelce\",\"proTeam\":{\"abbreviation\":\"KC\",\"location\":\"Kansas City\",\"name\":\"Chiefs\"},\"positionEligibility\":[\"TE\"]},\"requestedGames\":[{\"game\":{\"id\":6310,\"away\":{\"abbreviation\":\"KC\",\"location\":\"Kansas City\",\"name\":\"Chiefs\"},\"home\":{\"abbreviation\":\"LV\",\"location\":\"Las Vegas\",\"name\":\"Raiders\"},\"startTimeEpochMilli\":\"1606094400000\",\"status\":\"FINAL_SCORE\",\"awayScore\":35,\"homeScore\":31,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayResult\":\"WIN\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":80.0,\"formatted\":\"8/10\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"},\"value\":{\"value\":127.0,\"formatted\":\"127\"}},{\"category\":{\"id\":26,\"abbre